<script setup lang="ts">
import gsap from 'gsap';


const { error } = defineProps<{
  error: {
    message: string
    statusCode: string
  }
}>()

onMounted(() => {
    animateBox()
})

function animateBox() {
    const tl = gsap.timeline()

    tl.to('#box', {
        rotation: '+=5',
        yoyo: true,
        repeat: -1,
        ease: 'elastic(1, 0.4)'
    })
    .to('#box-lid', {
        x: 15,
        y: -30,
        delay: 1,
        ease: 'power1',
        onStart: () => {
            gsap.killTweensOf('#box')

            gsap.to('#box', { rotate: 0 })
        }
    })
    .to('#error', {
        x: 0,
        bottom: 'auto',
        scale: 1,
        opacity: 1,
        ease: 'back.in'
    })
    .to('#box-lid', {
        x: 0,
        y: 0,
        ease: 'power1',
    })
}
</script>

<template>
    <NuxtLayout>
        <div 
            class="w-screen h-screen relative overflow-hidden flex justify-center bg-black items-center"
            style="font-family: Poppins;"
        >
            <div
                id="error"
                class="max-w-sm w-full scale-5 opacity-20 absolute -bottom-20 -translate-x-8 backdrop-blur-md p-6"
                >
                <div class="flex flex-col gap-4 justify-center items-center">
                    <h1 class="text-7xl font-extrabold text-white drop-shadow-lg z-10">{{ error.statusCode }}</h1>
                    <p class="text-lg mt-2 text-white text-center font-medium z-10">Oops! {{ error.message }}</p>

                    <button
                        @click="$router.back()"
                        class="mt-4 w-52 text-center cursor-pointer bg-white text-black font-bold py-2 px-6 rounded-lg shadow-lg transition-all duration-300 z-10"
                    >
                        Go back
                    </button>
                </div>
            </div>

        <div id="box" class="absolute -bottom-20 brightness-40 scale-80 left-1/2 -translate-x-1/2">
            <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="193" height="228" viewBox="0 0 193 228" fill="none">
                <g id="box-group">
                    <rect id="box-base" width="184" height="184" fill="url(#pattern0_1_5)"/>
                    <rect id="box-lid" y="35" width="193" height="193" fill="url(#pattern1_1_5)"/>
                </g>
                <defs>
                    <pattern id="pattern0_1_5" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlink:href="#image0_1_5" transform="scale(0.000925926)"/>
                    </pattern>
                    <pattern id="pattern1_1_5" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlink:href="#image1_1_5" transform="scale(0.000925926)"/>
                    </pattern>
                    <image id="image0_1_5" data-name="Proyek tanpa judul-Layer 1 (46).png" width="1080" height="1080" preserveAspectRatio="none" xlink:href="data:image/png;base64,"/>
                    <image id="image1_1_5" data-name="Proyek tanpa judul-Layer 1 (47).png" width="1080" height="1080" preserveAspectRatio="none" xlink:href="data:image/png;base64,"/>
                </defs>
            </svg>
        </div>

    </div>
  </NuxtLayout>
</template>
